import "./modal_signup.css";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import simple_logo_img from "./assets/simple_logo.PNG";

function Modal_signup(props) {
  return (
    <Modal
      {...props}
      sige="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <img className="simple_logo" src={simple_logo_img} alt="logo2"></img>

        <Modal.Title id="contained-modal-title-vcenter">회원가입</Modal.Title>
      </Modal.Header>
      <Modal.Body>회원가입 form</Modal.Body>
      <Modal.Footer>
        <Button id="btn_signup_ok" onClick={props.onHide}>
          가입하기
        </Button>
      </Modal.Footer>
    </Modal>
  );
}
export default Modal_signup;
